import React from 'react';
import CustomNavbar from '../components/CustomNavbar';
import Breadcrumb from '../components/Breadcrumb';
import FooterTwo from '../components/Footer/FooterTwo';
import Partner from '../components/Partner';
import FooterData from '../components/Footer/FooterData';

const Paap = () =>{

    return (
        <div className="body_wrapper">
            <CustomNavbar slogo="sticky_logo" mClass="menu_tracking" nClass="w_menu ml-auto mr-auto"/>{/* ESTA ES LA PARTE DEL MENU DEL HOME */}
            {/*<CustomNavbar slogo="sticky_logo" mClass="menu_four" nClass="w_menu ml-auto mr-auto"/> */}
            <Breadcrumb breadcrumbClass="breadcrumb_area" imgName="breadcrumb/banner_bg.png" Ptitle="Programa de Asistencia Alimentaria a Personas de Atención Prioritaria (PAAP)" Pdescription=""/>{/**esta es la parte del banner */}
            <div class="row mb-3 pl_100 pr_100 mt_100 mb_100">
            <div class="col-lg-6">
            <h3 className='text-center'>Objetivo:</h3>
                <p className='text-justify'>Centrandose en la entrega de apoyo alimentario a la población con calidad nutrimental acompañados con acciones de difusión y orientación alimentaria e higienica con el fin de mejorar y apoyar a que la población mejore sus hábitos y con ello prevenir enfermedades crónico degenerativas.</p>
            </div>
            <div class="col-lg-6 text-center">
                <div>
                <h3>Este programa se especializa en atención<br/>a 3 sectores de la población:</h3>
                <p>1. Niñas y Niños de 2 a 5 años no escolarizados</p>
                <p>2. Adultos Mayores de 60 años</p>
                <p>3. Personas en situación de carencia alimentaria o desnutrición y discapacitados.</p>
                <h3>Requisitos:</h3>
                <p>1. CURP</p>
                <p>2. INE</p>
                <p>3. Comprobante de Domicilio Vigente</p>
                <p>4. INE del reponsable de recoger la despensa en caso de no poder recogerla el beneficiario</p>
                <p className='text-justify'>*Las listas de los beneficiarios serán publicadas por medios electrónicos, de manera física en las oficinas centrales de DIF Jocotepec y en las delegaciones.</p>
                <h3>Dirección:</h3>
                <p>Calle Hidalgo #6 Centro, Jocotepec</p>
                <h3>Horario:</h3>
                <p>Lunes a Viernes de 9:00 a 15:00 horas</p>
                <h3>Teléfono:</h3>
                <a href='tel:3877632799'>387 763 27 99</a>
                </div>
            </div>
            </div>
            <div className='row'>
            <div className='container text-center pt_160 sec_pad_b'>
                <h3>Mapa del centro de atención:</h3>
            <iframe title="Mapa"src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3742.3369660319595!2d-103.43261758507965!3d20.28631488640522!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x842f5bf570930269%3A0x1ece9fa45e10c2dc!2sC.%20Hidalgo%20Eje%20Sur%206%2C%20Jocotepec%20Centro%2C%2045800%20Jocotepec%2C%20Jal.!5e0!3m2!1ses!2smx!4v1652996368960!5m2!1ses!2smx" width="600" height="450"></iframe>
            </div>
            </div>
            <Partner pClass="partner_logo_area_two" pClasst="pt-0 mb-0"/>{/**esta es la parte de los logos de la dependencia */}
            <FooterTwo fClass="pt_150" FooterData={FooterData}/>{/**esta es la parte footer */}
        </div>

    );

}
export default Paap;
